import React, { useEffect } from 'react'

import './App.css'

import {
	createApp,
	ImageShape,
	TextShape,
	StrokeShape,
	loadImage,
	computeMaxArea,
	GroupShape,
	RubberShape,
	RectShape,
} from './../../../packages/src/index'
import JSONData from './../../data/framework.json'
import { Header, Loading, Message } from './../../components/index'
function App() {
	const creatEdit = async () => {
		// console.log(document.querySelector('.App'))
		const cropInstance = createApp({
			el: '.App',
			penColor: '#f80',
			penWidth: 2,
			canDraw: true,
			canRender: true,
			nativeEventStop: false,
			nativeEventPrev: false,
			graphics: [
				GroupShape,
				ImageShape,
				RubberShape,
				RectShape,
				TextShape,
				StrokeShape,
			],
		})

		cropInstance.use({
			type: Loading,
			name: 'Loading',
			params: [{ show: true }],
		})
		cropInstance.use({
			type: Message,
			params: { duration: 5000 },
			name: 'Message',
		})

		cropInstance.use({
			type: Header,
			name: 'Header',
		})

		return cropInstance
	}

	const init = async () => {
		const container = await creatEdit()

		;(JSONData as any).forEach((element: any) => {
			container.appendToImage(element)
		})

		const img = await loadImage(
			'https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png',
		)
		const area = computeMaxArea(container, img)
		const data = {
			imageOrUri: img,
			width: area.width / 4,
			height: area.height / 4,
			x: area.x + area.width / 4 / 4,
			y: area.y + area.height / 4 / 4,
		}

		const imgNode = new ImageShape({
			imageOrUri: img,
			width: 166.25,
			height: 163.26942231075697,
			x: 83.5625,
			y: 115.77851095617531,
		})

		const img2 = await loadImage(
			'data:image/png;base64,',
		)

		const data2 = {
			imageOrUri: img2,
			width: 284.25,
			height: 176.01072041166384,
			x: 326.5625,
			y: 114.99463979416808,
		}
		const imgNode2 = new ImageShape(data2)

		container.add(new ImageShape(data2))
		container.add(new ImageShape(data))
		container.add(imgNode2.clone())

		container.add(imgNode).add(imgNode2).resize({
			width: 655,
			height: 780,
		})
		;(container as any).hideLoading()

		// window.getData = () => {
		// 	console.log(JSON.stringify(container.getCurrentPageData()))
		// }
		// window.getH = () => {
		// 	console.log(console.log(container.history))
		// }
	}

	useEffect(() => {
		init()
	}, [])

	return <div className="App"></div>
}

export default App
